sys_variable_value.value:
workflow.scratchpad.book_number = "";


var grBook = new GlideRecord("x_alpa2_services_book");
grBook.initialize();
grBook.title = current.variables.titulo;
grBook.description = current.variables.descricao;
grBook.owner = current.caller;
grBook.author = current.variables.autor;
var idBook = grBook.insert();
workflow.scratchpad.book_number = grBook.number;

var grBookRequest = new GlideRecord("x_alpa2_services_m2m_book_request");
grBookRequest.initialize();
grBookRequest.book = idBook;
grBookRequest.request = current.sys_id.toString();
grBookRequest.insert();

current.comments = "Livro registrado com o número: " + workflow.scratchpad.book_number;

